script: |
  super -f text -I q8093.spq | sort > q8093.out

inputs:
  - name: q8093.spq
    data: |
      SELECT + - CAST ( + - col1 AS INTEGER ) * col2 AS col0, 36 * - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN NULL AND + + col2;
  - name: tab0

outputs:
  - name: q8093.out
    data: |
